  COLORS,
  SIZES,
  FONTS,
  TABS,
  FLATFORMS,
  HEADER,
  RADIUS,
  LOCATION,
  SLIDER_WIDTH,
  ITEM_WIDTH_HOME,
  HEIGHT_HOME,
  ITEM_WIDTH_DETAIL,
  HEIGHT_DETAIL,
  FORMAT_DATE,
  CURRENCY_CONVERT,
  PAYMENT_DEPOSIT,
  PAYMENT_STATUS,
  NOTIFICATION_TYPE,
  TAB_STATUS,
  TAB_NAME,
  PRICE_TYPE_SORT,
};
